import React, { Component } from "react";
import SweetAlert from "react-bootstrap-sweetalert";

class MustLogIn extends Component {
  render() {
    return (
      <SweetAlert success title="Woot!" onConfirm={() => this.hideAlert()}>
        Hello world!
      </SweetAlert>
    );
  }
}

export default MustLogIn;
